import { BrowserRouter, Route, Switch } from "react-router";
import Catalog from "./page/Catalog/Catalog";
import Home from "./page/Home/Home"

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/">
          <Home />
        </Route>
        <Route path="Catalog">
        <Catalog />
        </Route>
    </Switch>
    </BrowserRouter >
  );
}

export default App;
